import React from 'react';
import './Post.css';

const Modal = ({ active, setActive }) => {
  return (
    <div className="modal" onClick={() => setActive(false)}>
      <div className="modal-content" onClick={(e) => e.stopPropagation}></div>
    </div>
  );
};

export default Modal;
